  \"2015-08-14T06:38:36.668826\",\n\t\"name\": \"projecting-images-on-a-sphere-d18cb\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A system for projecting images on an object
  with a reflective surface. A plurality of image projectors are spaced around the
  object and synchronized such that each projector projects an individual image whose
  union on the surface of the object forms a composite image. The composite image
  displayed totally covers the surface. The object may represent the Earth with the
  projected images representing topographical features of the Earth. If environmental
  satellite data, such as data from a Geostationary Orbiting Environmental Satellite
  System is used, real time weather conditions may be displayed on this Earth representation.\",\n\t\"license_title\":
